import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import Divider from '@material-ui/core/Divider';
import { List } from '@material-ui/core';

const useStyles = makeStyles({
  card: {
    minWidth: 770 ,
    minHeight:150,
    top: 80,
    position: 'relative'
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
});

export default function SimpleCard() {
  const classes = useStyles();
  const bull = <span className={classes.bullet}>•</span>;

  return (
    <Card className={classes.card}>
        
      <CardContent>
      <List horizontal style={{display:'flex',justifyContent:'space-around',backgroundColor:'#EFFEFE'}}>
        <Avatar alt="not" src="/Pic/D1.jpg" className={classes.bigAvatar,classes.Tavatar} />                
        <div style={{position:'relative',left:-50}}> Word of the name</div>
        <Typography className={classes.title} color="textSecondary" gutterBottom>收货地址</Typography>
        <Typography className={classes.title} color="textSecondary" gutterBottom>优惠信息</Typography>
        <Typography className={classes.title} color="textSecondary" gutterBottom>会员信息</Typography>              
        </List>
        
        <Divider style={{position:'relative',top:10}} />
        <List  horizontal style={{display:'flex',justifyContent:'space-around',top:20,bottom:-1}} dense="true" >
        <Typography  color="textSecondary" gutterBottom>待付款<span>1</span></Typography>
        <Divider  orientation="vertical" variant="middle"/>
        <Typography  color="textSecondary" gutterBottom>待发货</Typography>
        <Divider orientation="vertical" />
        <Typography  color="textSecondary" gutterBottom>待收货</Typography>
        <Divider orientation="vertical" />
        <Typography  color="textSecondary" gutterBottom>待评价</Typography>
        <Divider orientation="vertical" />
        <Typography  color="textSecondary" gutterBottom>退款</Typography>
        </List>
      </CardContent>
      <CardActions>
        {/* <Button size="small">Learn More</Button> */}
      </CardActions>
    </Card>
  );
}
